script: |
  super -f text -I q4644.spq | sort > q4644.out

inputs:
  - name: q4644.spq
    data: |
      SELECT - col0 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN NULL AND NULL AND NOT + col0 * col0 NOT IN ( ( + 95 ) + 12 );
  - name: tab0

outputs:
  - name: q4644.out
    data: |
